    false,nt"url": null,nt"notes": "This line feature represents the jurisdictional
    boundary along the California coastline that defines EPA (Inland Zone) and Coast
    Guard (Coastal Zone) emergency response jurisdictions. The U.S. Environmental Protection
    Agency / U.S. Coast Guard (USEPA / USCG) Jurisdictional Boundary runs from the Oregon
    to the Mexican border adjacent to the coastline. The boundary was developed from
    text descriptions provided in the U.S. Environmental Protection Agency Region 9
    Mainland Regional Contingency Plan dated March 17, 1994. The Bolsa Chica Ecological
    Reserve was added to the EPA's jurisdiction in 2011.",nt"license_title": null,nt"extras":
